import Nav from './PaginaWeb/nav.js';
import Show from './Villanos/Show';
import Edit from './Villanos/Edit';

function app() {
  return (<div>
   <BrowserRouter>
            <Nav />
            <br></br> <br></br> <br></br> <br></br>
      <Routes>
            <Route path="/" element={<Show />} />
            <Route path='/edit/:id' element={ <Edit /> } />
      </Routes>
    </BrowserRouter>
  </div>


  );
}

export default app;
